    def __init__(self, *args):
        super(SequentialAppendList, self).__init__(*args)
    def forward(self, x: torch.Tensor, concat_list: List[torch.Tensor]) -> torch.Tensor:
        for i, module in enumerate(self):
            if i == 0:
